style.css:
body {
    background-color: #121212;
    color: #e0e0e0;
    font-family: Arial, sans-serif;
}

/* Links */
a {
    color: #bb86fc;
    text-decoration: none;
}

a:hover {
    text-decoration: underline;
}

/* Headings */
h1, h2, h3, h4, h5, h6 {
    color: #ffffff;
}

/* Paragraphs */
p {
    color: #e0e0e0;
}

/* Buttons */
button {
    background-color: #333333;
    color: #ffffff;
    border: 1px solid #444444;
    padding: 10px 20px;
    cursor: pointer;
}

button:hover {
    background-color: #444444;
}

/* Inputs and Textareas */
input, textarea {
    background-color: #333333;
    color: #ffffff;
    border: 1px solid #444444;
    padding: 10px;
}

/* Forms */
form {
    background-color: #1e1e1e;
    padding: 20px;
    border-radius: 5px;
}

/* Navigation */
nav {
    background-color: #333333;
    padding: 10px;
}

nav a {
    color: #bb86fc;
    margin-right: 10px;
}

/* Footer */
footer {
    background-color: #1e1e1e;
    color: #888888;
    text-align: center;
    padding: 20px;
    position: fixed;
    bottom: 0;
    width: 100%;
}

/* Tables */
table {
    width: 100%;
    border-collapse: collapse;
}

table, th, td {
    border: 1px solid #444444;
}

th, td {
    padding: 10px;
    text-align: left;
}

th {
    background-color: #333333;
}

td {
    background-color: #1e1e1e;
}

/* Code Blocks */
pre, code {
    background-color: #333333;
    color: #e0e0e0;
    padding: 10px;
    border-radius: 5px;
}
